INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (11519, 1079, 'Atomoxetine', 'Heart Diseases', 'The use of CNS stimulants is contraindicated in patients with significant cardiovascular impairment such as uncompensated heart failure, severe coronary disease, severe hypertension (including that associated with hyperthyroidism or pheochromocytoma), cardiac structural abnormalities, serious arrhythmias, etc.  Sudden death has been reported in adults and children taking CNS stimulant treatment.  Additionally, stroke, myocardial infarction, chest pain, syncope, arrhythmias and other symptoms have been reported in adults under treatment.  A careful assessment of the cardiovascular status should be done in patients being considered for treatment.  This includes family history, physical exam and further cardiac evaluation (EKG and echocardiogram).  Patients who develop symptoms should have a detailed cardiac evaluation and if needed, treatment should be suspended.', '3', '', 'DDInter', 0);
